import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <div className="bg-black text-gray-200 font-sans">
            <Header />
            <main className="container mx-auto px-6">
                <Hero />
                <About />
                <Experience />
                <Skills />
                <Projects />
                <Contact />
            </main>
            <Footer />
        </div>
    </div>
  );
}
